INSERT INTO `content` (`id`, `heading`, `text`, `link`, `identifier`) VALUES
(1, 'Poster gestern und heute', 'Willkommen auf poster-welt.de! Schön, dass du es auf unsere Seite geschafft hast! Bei deiner Suche nach einem schönen, hochwertigen und preisgünstigen Poster helfen wir dir gerne. Schau dich um und finde Poster mit Kunstdrucken, Fanposter mit deinen Lieblingsstars, Poster für Kinder, Filmposter und vieles mehr. Anstatt dich mühsam durch eine Vielzahl von Geschäften zu quälen, kannst du bei uns dein neues Poster ganz einfach online aussuchen und dir nach Hause liefern lassen. Auf poster-welt.de findest du eine riesige Auswahl, die keine Wünsche offen lässt. Viel Spaß beim Stöbern!\r\n<br><br>\r\n\r\nWas ist eigentlich das Besondere an einem Poster? Poster sind eine Art des Plakats, die aber nicht der Informationsvermittlung dienen, sondern einen dekorativen Zweck haben. Im Gegensatz zu Bildern oder Gemälden bestehen Poster aus beschichtetem Papier und werden meistens ohne Rahmen verkauft. Dadurch sind sie zu günstigen Preisen erhältlich und besonders leicht und einfach zu transportieren. Natürlich kann jedes Poster aber auch in einen Rahmen gefasst werden, was zu einer edleren und hochwertigeren Optik führt.\r\n<br><br> \r\nDas Werbeplakat, als Vorgänger des Posters bereits seit dem 16./17. Jahrhundert bekannt, wurde ab den 1890er Jahren zunehmend auch aus einer künstlerischen Perspektive betrachtet. Im Zuge der sogenannten ?Plakatbewegung? wurden Plakate nach den Kriterien der freien Kunst beurteilt und gesammelt. Es entstanden Ausstellungen, die sich dem Plakat widmeten und Kunsthändler begannen, sich auf diese neue Kunstform zu spezialisieren. Ab 1900 setzte sich dann jedoch die Erkenntnis durch, dass die künstlerische Qualität und die Werbewirksamkeit eines Plakat nicht unbedingt miteinander korrelierten. Von da an wurde das Werbeplakat nicht mehr als Kunstform angesehen, wohingegen das künstlerisch wertvolle Plakat als Poster weiterlebt.\r\n<br><br> \r\nSeinen Siegeszug durch Wohnräume auf der ganzen Welt hat das Poster Ende der 50er Jahre begonnen, als die Kunstform ?Pop-Art? entstand. Seitdem sind Poster aus der Inneneinrichtung nicht mehr wegzudenken. ', 'poster-gestern-und-heute', 'text-1'),
(2, 'Mit Postern deinen Stil ausdrücken', 'Was die Form und das Motiv eines Posters angeht, so sind der Phantasie heute keinerlei Grenzen mehr gesetzt. Mit einem gut gewählten Poster, kannst du deine Wohnräume verschönern, deinen eigenen Stil unterstreichen und deine Zuneigung zu einem bestimmten Thema ausdrücken.\r\n<br><br> \r\nFür alle Kunstliebhaber gibt es auf unseren Seiten ein großes Angebot an Reproduktionen berühmter Gemälde und Fotografien. Besonders beliebt sind die Klassiker des Barock wie ?Das Mädchen mit dem Perlenohring? von Jan Vermeer, der abstrakten Kunst wie ?Winter Bild? von Paul Klee, der Romantik wie ?Wanderer über dem Nebelmeer? von Caspar David Friedrich, des Impressionismus wie ?Seerosen? von Claude Monet, des Jugendstils wie ?Der Kuss? von Gustav Klimt, des Realismus wie ?Nachtschwärmer? von Edward Hopper oder des Expressionismus wie ?Der Schrei? von Edvard Munch. \r\n<br><br> \r\nDu liebst es, draußen zu sein und möchtest deine Naturverbundenheit zum Ausdruck bringen? Auf poster-welt.de findest du eine große Auswahl an Postern, die dich dabei unterstützen. Wie wäre es mit traumhaften Fotodrucken von heimischen Stränden, Wäldern, Bergen oder der ursprünglichen Tierwelt? Wenn es dich etwas weiter in die Ferne zieht, wäre vielleicht eine exotischere Landschaft mit Wüste, Palmen oder der Südsee das richtige Motiv für dich. Fotoposter von beeindruckenden wilden Tieren, wie Löwen, Elefanten, Tiger und Adler findest du bei uns ebenso wie Poster mit Fotografien von Haustieren wie Pferden, Hunden, Katzen oder Hasen.\r\n<br><br> \r\nMit diesen Motiven holst du dir ein kleines Stückchen Urlaub in deinen Alltag. Du verbringst deine Ferien lieber in aufregenden Städten? Deine Reiselust kannst du auch mit Postern zeigen, die deine Lieblingsstadt als Foto oder Stadtplan zeigen. Besonders gut in Wohn- und Arbeitsräumen machen sich auch Poster, auf denen berühmte Sehenswürdigkeiten abgebildet sind ? der Eiffelturm, das Brandenburger Tor, das Taj Mahal, Machu Picchu, die Golden Gate Bridge, Christo Redentor und zahlreiche andere Wahrzeichen bekannter Städte. Oder würde dir eine großformatige Weltkarte am besten gefallen? \r\n<br><br> \r\nDu kochst gerne und möchtest deine Küche verschönern? Dann empfehlen wir dir Poster, in denen es um das Thema Essen, Ernährung und Genuss geht. Du hast die Wahl zwischen ästhetischen Fotografien von Lebensmitteln wie Kaffee, Obst, Gemüse oder fertig zubereiteten Gerichten oder modernen Grafiken verschiedener angesagter Rezepte, zum Beispiel Guacamole, Moscow Mule oder Gazpacho. Ebenso findest du auf poster-welt.de Poster mit einfallsreichen Sprüchen und Schlagworten zum Thema Kochen und Ernährung. \r\n<br><br> \r\nPoster sind eine tolle Möglichkeit, zu zeigen, dass man Fan von etwas ist. Bei uns hast du die Auswahl zwischen Fanpostern, auf denen deine Lieblingsstars, -vereine, -serien oder was auch immer als realistische Fotografien abgebildet sind und sogenannter Fan Art. Dabei handelt es sich um eine künstlerische Hommage, die den Menschen oder das Produkt in Form einer Zeichnung, eines Gemäldes oder einer grafischen Gestaltung verewigt. Auch wenn du Nachdrucke von originalen Filmpostern suchst, können wir dir behilflich sein. Besonders beliebt sind Fanposter von Fußballvereinen wie Bayern München oder Borussia Dortmund, Serien wie ?The Big Bang Theory? und ?Breaking Bad?, Filme wie ?Pulp Fiction? und ?Star Wars?, Künstler wie Frida Kahlo, Musiker wie die Beatles, David Bowie oder Pharell Williams oder Poster von Schauspielern wie Audrey Hepburn oder Ryan Gosling. \r\n<br><br> \r\nDu bist kein Fan, hast aber ein besonderes Hobby? Egal ob Wandern, Schwimmen, Kochen, Lesen, Radfahren, Fotografieren, Malen, Musizieren oder Reisen ? sicher findet du auf poster-welt.de das passende Poster, mit dem du jedem zeigen kannst, wofür du dich begeisterst. \r\n<br><br> \r\nEin tolles Geschenk für Kinder und eine schöne Möglichkeit das Kinderzimmer zu individualisieren und zu verschönern sind Poster. Lehrreiche und gleichzeitig schöne Abbildungen von Buchstaben und Zahlen oder die bildliche Erklärung eines bestimmten Themas (zum Beispiel Weltall, Tiere des Waldes, Landkartenoder Besuch beim Arzt) können auf einem Poster für Kinder umgesetzt werden. Da viele Kinder ihre Interessen rasch ändern, ist ein Poster die ideale Möglichkeit, das Kinderzimmer zu gestalten. Da Poster billig zu haben und platzsparend aufzubewahren sind, ist es ganz einfach, die Wandbilder immer wieder auszutauschen. ', 'mit-postern-deinen-stil-ausdruecken', 'text-2'),
